import React, { Component } from "react";
import { ReactNavbar } from "./Navbar/index";
import { Gallery, MyCrabs } from "../views";
import { getInjectedProvider } from "web3modal";

export default ({ address }) => {
  return (
    <ReactNavbar
      color="rgb(25, 25, 25)"
      logo="img/crabgif.gif"
      menu={[
        { name: "Home", to: "/", component: Gallery },
        { name: "My Crabrades", to: "/yourcollectibles", component: MyCrabs },
        { name: "Clawlery", to: "/gallery", component: Gallery },
        { name: "Crabmap", a: "/#crabmap" },
        { name: "F.C.Q.", a: "/#fcq" },
      ]}
      social={[
        {
          name: "Linkedin",
          url: "https://www.linkedin.com/in/nazeh-taha/",
          icon: ["fab", "linkedin-in"],
        },
        {
          name: "Facebook",
          url: "https://www.facebook.com/nazeh200/",
          icon: ["fab", "facebook-f"],
        },
        {
          name: "Instagram",
          url: "https://www.instagram.com/nazeh_taha/",
          icon: ["fab", "instagram"],
        },
        {
          name: "Twitter",
          url: "http://nazehtaha.herokuapp.com/",
          icon: ["fab", "twitter"],
        },
      ]}
      account={
        <div style={{ position: "fixed", textAlign: "right", right: 0, top: 0, padding: 10 }}>
          <Account
            address={address}
            localProvider={injectedProvider}
            userProvider={injectedProvider}
            mainnetProvider={injectedProvider}
            price={price}
            web3Modal={web3Modal}
            loadWeb3Modal={loadWeb3Modal}
            logoutOfWeb3Modal={logoutOfWeb3Modal}
            blockExplorer={blockExplorer}
          />
          {/* {faucetHint} */}
        </div>
      }
    />
  );
};
